import { NgModule } from '@angular/core';
import { UsersPage } from './users.page';
import {
  InitDetailsResolver,
  PhotosServiceModule,
  UserAlbumsStateModule,
  UsersListComponent,
  UsersServiceModule,
  UserStorageModule,
} from '@user-albums';
import { RouterModule } from '@angular/router';
import { UserDetailsPage } from './user-details.page';
import { PhotosComponent } from '../../../projects/user-albums/src/lib/adapters/primary/components/photos/photos.component';

const routes = [
  {
    path: '',
    component: UsersPage,
  },
  {
    path: `:userId`,
    component: UserDetailsPage,
    resolve: { initDetails: InitDetailsResolver },
  },
];

@NgModule({
  imports: [
    UsersListComponent,
    UsersServiceModule,
    UserAlbumsStateModule,
    PhotosServiceModule,
    UserStorageModule,
    RouterModule.forChild(routes),
  ],
  declarations: [UsersPage],
  providers: [InitDetailsResolver],

  exports: [UsersPage],
})
export class UsersPageModule {}
